    f.write(','.join(unique_plates))
    f.write("\n\n")
    f.write("=" * 100 + "\n")
    f.write("去重后的车牌号列表（每行一个）\n")
    f.write("=" * 100 + "\n\n")
    for plate in unique_plates:
        f.write(f"{plate}\n")

